import React from 'react';
import './HeroSection.scss';
import confidenceImage from '../assets/confidence.jpeg';

const HeroSection: React.FC = () => {
  return (
    <section className="hero-section">
      <div className="hero-content">
        <h1>Live with Confidence</h1>
        <p>José Mourinho brings confidence to pan-African Sanlam campaign.</p>
        <button className="hero-button">View project</button>
      </div>
      <div className="hero-image">
        <img
          src="https://via.placeholder.com/1000x500"
          alt="José Mourinho"
        />
      </div>
    </section>
  );
};

export default HeroSection;
